import React, { Component } from "react";
import { Link } from "react-router-dom";
export default class Navbar extends Component {
    render(){
        return (
        <nav className="navbar navbar-dark bg-light-green navbar-expand-lg">
            <Link to="/"  className="navbar-brand">JaiRam Sing Pvt ITI Bilram</Link>
            <div className="collapse-navbar-collapse">
                <ul className="navbar-nav mr-auto">
                    <li className="navbar-item">
                        <Link to="/" className="nav-link">Admission</Link>
                    </li>
                    <li className="navabar-item">
                        <Link to="/create" className="nav-link">Fee Details</Link>
                    </li>
                    <li className="navbar-item">
                        <Link to="/user" className="nav-link">Trades</Link>
                    </li>
                </ul>
            </div>
        </nav>
        );
    }
}
